import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="container">
        <h1>Weather App</h1>
        <footer>
          This project was coded by{" "}
          <a href="https://github.com/Fetty10"> Fetty</a> and{" "}
          <a href="https://github.com/Fetty10/fetty-react-weather-app">
            {" "}
            open-sourced on GitHub
          </a>
        </footer>
      </div>
    </div>
  );
}

export default App;
